const Header = () => {
    return (
        <div className="header">
            <div className="logo-container">
            <img className="logo" src = {LOGO}></img>
            </div>
            <div className="nav-items">
                <ul>
                    <li>Home</li>
                    <li>About Us</li>
                    <li>Contact Us</li>
                    <button class="login">Login</button>
                </ul>
            </div>
        </div>
    )}

    export default Header;
